import React from 'react';
import './SideBar.css';
import SignUpButton from '../Modals/SignUpBtn';

function SidebarItem({ menu }) {
    return (
        <div className="sidebar-item">
            <li>{menu.name}</li>
            <SignUpButton />
        </div>
    );
}

export default SidebarItem;
